import React from "react";
import { Carousel } from 'react-responsive-carousel';
import "react-responsive-carousel/lib/styles/carousel.min.css";


export default function CarouselComponent() {
    return (
        <div className="carousel-wrapper">
            < Carousel infiniteLoop useKeyboardArrows autoPlay>
                <div>
                    <img src=" https://curlytales.com/wp-content/uploads/2020/07/Biryani-1-1024x576.jpg" />
                    <p className="Legend">Delicious quality chicken Biriyani</p>                
                </div>
                <div>
                    <img src=" https://c.ndtvimg.com/2018-10/ohqcobr_handi-biryani_625x300_08_October_18.jpg" />
                    <p className="ultralegend">Protien Rich Biriyani</p>
                </div>
                
            </Carousel>
        </div>
        
    );
}
